const icon = 'data:image/svg+xml;base64,';
  class Discord {
    getInfo() {
      return {

        id: 'Discord',
        name: 'Discord bot webhook',

        color1: '#5865F2',
        color2: '#57F287',
        color3: '#FEE75C',

        menuIconURI: icon,

        blocks: [
          {
            opcode: 'send_message_block',
            blockType: Scratch.BlockType.COMMAND,
            text: 'send message [MESSAGE] as [USERNAME] avatar url: [AVATAR] webhook url: [WEBHOOK_URL]',
            arguments: {
              MESSAGE: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'Text send from TurboWarp!'
              },
              USERNAME: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'TurboWarp Bot'

             },
              AVATAR: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'https://i.postimg.cc/4ymPNfNG/257734567-74d9c9ba-b245-4046-819c-f2275f1df01f-1.jpg'
              },
              WEBHOOK_URL: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'https://discord.com/api/webhooks/'
              }
            }
          },
          {
            opcode: 'send_json_block',
            blockType: Scratch.BlockType.COMMAND,
            text: 'send json [JSON_DATA] webhook url: [WEBHOOK_URL]',
            arguments: {
              JSON_DATA: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: '{"content": "Text send from TurboWarp!","embeds": null,"attachments": []}'
              },
              WEBHOOK_URL: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'https://discord.com/api/webhooks/'
              }
             }
            }
        ]
      }

    }
    send_message_block({MESSAGE,USERNAME,WEBHOOK_URL,AVATAR}){
        var json_data = {
            username: USERNAME,
            avatar_url: AVATAR,
            content: MESSAGE
        }
      try {return fetch(WEBHOOK_URL, {
            method: "POST",
            headers: {
              'Content-type': 'application/json'
            },
            body: JSON.stringify(json_data)
          }).then(res => {
            console.log(res);
          })
      }
    catch(err) {}
    }
    send_json_block({JSON_DATA,WEBHOOK_URL}){
      try {return fetch(WEBHOOK_URL, {
            method: "POST",
            headers: {
              'Content-type': 'application/json'
            },
            body: (JSON_DATA)
          }).then(res => {
            console.log(res);
          })
      }
    catch(err) {}
    }
}
Scratch.extensions.register(new Discord());
